import { BrowserRouter } from 'react-router-dom';
import BottomInputBar from './onboarding/BottomInputBar';
import OnboardingLayout from './onboarding/OnboardingLayout';
import OnboardingStep1 from './onboarding/OnboardingStep1';
import WeatherImageGrid from './onboarding/WeatherImageGrid';

function App() {
  return (
    <div>
      <OnboardingLayout>
        <OnboardingStep1 />
        <WeatherImageGrid />
      </OnboardingLayout>
      <BottomInputBar />
    </div>
  );
}

export default App;
